import React, { memo } from "react";

import { UserLoginWrapper } from "./style";

export default memo(function LJUserLogin() {
  return (
    <div>
      <UserLoginWrapper>
        <p></p>
        <a href="/todo"></a>
      </UserLoginWrapper>
    </div>
  );
});
